import {makeAutoObservable} from "mobx"

class OneUser {
    constructor(id,fn,sn,img,email,mark,countState,isAdmin){
        this._id =  id;
        this._fn = fn;
        this._sn = sn;
        this._img = img;
        this._email = email;
        this._mark = mark;
        this._countState = countState;
        this._isAdmin = isAdmin;
    }
    setIsAdmin(admin){
        this._isAdmin = admin
    }

    get IsAdmin(){
        return this._isAdmin
    }

    get id(){
        return this._id
    }

    get fn(){
        return this._fn;
    }

    get sn(){
        return this._sn;
    }

    get img(){
        return this._img
    }

    get email(){
        return  this._email
    }

    get mark(){
        return this._mark
    }

    get countState(){
        return this._countState
    }
};



export default class UsersConteiner{
    constructor(){
        this._users = [{
            user: new OneUser(1, "Филатьев", "Владислав", "../img/defaut_awatar.jpg", "fill@yandex.ru",
            4.5, 102, false
        )},
        {user: new OneUser(2, "Иванов", "Сергей", "../img/defaut_awatar.jpg", "Invanow@mail.ru",
            3.2, 11, false
        )
    }];
        makeAutoObservable(this)
    }

    setUsers(users){
        this._users = users
    }

    get users(){
        return this._users
    }

    

}
